import React from 'react';
import './index.css';
import logo from './component/BachKhoaLogo.png'

function Spss(){
    return (
        <div className='NavigationBar'>
            <div>
                <img src={logo} alt = "logo" className='logoimage'></img>
            </div>
            <div>
                <p>HCMUT</p>
                <h1>SPSS</h1>
            </div>
        </div>
    );
}

export default Spss;
